def vapPrToRH(vp, sat_vp):

    if (sat_vp == 0):
        rh = 100
    else:
        rh = (vp / sat_vp) * 100.

    # Any out of bounds value is converted to a boundary value
    if rh > 100:
        rh = 100
    elif rh < 0:
        rh = 0
    return rh

