def point_dividing_a_line_segment(A, B, offset_from_A):


    x = (1 - offset_from_A) * A[0] + offset_from_A * B[0]
    y = (1 - offset_from_A) * A[1] + offset_from_A * B[1]

    return int(round(x)), int(round(y))

def cdist(x, y):


