def glob_to_re(glob):

    globOffset = 0
    globLen    = len(glob)
    regex      = '^'
    while globOffset < globLen:
        globChar   = glob[globOffset]
        globOffset = globOffset + 1
        if globChar == "*":
            regex = regex + '.*'
        elif globChar == "?":
            regex = regex + '.'
        elif globChar in [".","[","]","\\","^","$","+","{","}","|","(",")"]:
            regex = regex + '\\' + globChar
        else:
            regex = regex + globChar
    regex = regex + "$"
