def search(seq, val):


    lo, hi = 0, len(seq)-1
    while lo <= hi:
        mid = (lo + hi) // 2
        if val < seq[mid]:
            hi = mid - 1
        elif val > seq[mid]:
            lo = mid + 1
        else:
            return mid
    return -1

