def parse_num_suffix(num):


    if not num:
        return None

    suffixes = {
        'G': 1000000000,
        'M': 1000000,
        'K': 1000
    }

    if not num[-1].isalpha():
        return int(num)

    suffix = num[-1].upper()
    if suffix not in suffixes:
        raise ValueError(
            "'{}' is not a valid number. Supported suffixes: {}".format(
                num, ", ".join(iter(suffixes.keys()))
            ))

    return int(num[:-1]) * suffixes[suffix]

