def get_saturation(value, quadrant):

    if value > 223:
        return 255
    elif value > 159:
        if quadrant != 1:
            return 255

        return 0
    elif value > 95:
        if quadrant == 0 or quadrant == 3:
            return 255

        return 0

    elif value > 32:
        if quadrant == 1:
            return 255

        return 0
    else:
        return 0

