def mean_and_median(values):

    mean = sum(values) / len(values)
    midpoint = int(len(values) / 2)
    if len(values) % 2 == 0:
        median = (values[midpoint - 1] + values[midpoint]) / 2
    else:
        median = values[midpoint]

    return mean, median

def cvtStokesToIntensity(img_stokes):

    S0 = img_stokes[..., 0]
    return S0*0.5

import torch

def inverse_sigmoid(x, eps=1e-5):

    x = x.clamp(min=0, max=1)
    x1 = x.clamp(min=eps)
    x2 = (1 - x).clamp(min=eps)
    return torch.log(x1 / x2)

def compose_terms_with_mag(terms, magnitude):

    assert(len(terms) > 0)
    return terms[0].compose(terms, magnitude)

def weight_param(name, learn_all=True):

    lr_mult = decay_mult = 1 if learn_all else 0
    return dict(name=name, lr_mult=lr_mult, decay_mult=decay_mult)

def warmup_linear_flat(x, warmup=0.002):

    if x < warmup:
        return x/warmup
    return 1.0

